import React from 'react';
import { Box, Typography, Button } from '@mui/material';
import { useNavigate } from 'react-router-dom';

function CalendarComingSoon() {
  const navigate = useNavigate();

  return (
    <Box
      sx={{
        minHeight: 'calc(100vh - 64px)',
        background: 'url(https://source.unsplash.com/1600x900/?calendar,abstract) no-repeat center center fixed',
        backgroundSize: 'cover',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        py: 4,
        px: 3,
      }}
    >
      <Box
        sx={{
          textAlign: 'center',
          color: '#fff',
          background: 'rgba(17, 17, 17, 0.85)',
          padding: '3rem',
          borderRadius: '16px',
          boxShadow: '0 8px 30px rgba(0, 0, 0, 0.3)',
          maxWidth: '500px',
          mx: 'auto',
        }}
      >
        <Typography variant="h3" sx={{ mb: 2, color: '#FF4D6A', fontWeight: 'bold' }}>
          Calendar
        </Typography>
        <Typography variant="h6" sx={{ mb: 4, color: 'rgba(255, 255, 255, 0.8)' }}>
          Exciting features are on the way!
        </Typography>
        <Typography variant="body1" sx={{ mb: 4, color: 'rgba(255, 255, 255, 0.6)', fontStyle: 'italic' }}>
          Stay tuned for our interactive calendar feature.
        </Typography>
        <Button
          variant="contained"
          onClick={() => navigate('/dashboard')}
          sx={{
            bgcolor: 'rgba(220, 20, 60, 0.9)',
            '&:hover': { bgcolor: 'rgba(220, 20, 60, 1)' },
            fontSize: '1.1rem',
            px: 4,
            py: 1.5,
            transition: 'transform 0.3s ease',
            boxShadow: '0 4px 15px rgba(220, 20, 60, 0.4)',
          }}
        >
          Back to Dashboard
        </Button>
      </Box>
    </Box>
  );
}

export default CalendarComingSoon;
